window.bookSummaryJSON = "<p>A side quest adventure in the same world as the best-selling Awaken Online series. This story takes place after the end of <i>Awaken Online: Precipice</i>. </p> <p>Riley's real-life took a nosedive after her confrontation with Alex. The girls at school torment her and she feels powerless to do anything about it. At the same time, Jason has mysteriously disappeared, sending only a terse cryptic message to Riley and Frank. </p> <p>With some time on her hands and with her frustration with her real-life reaching a breaking point, Riley decides to strike off on her own in-game. Her goal is to investigate the quest related to the strange bow she discovered in the dungeon north of Peccavi. Yet events quickly spiral out of control as she discovers that the bow's former owner has set her along a path of vengeance - with an entire city hanging in the balance. </p>"; 
